No.

The query is asking for the book written by Muhammad Ali, but the variable ?uri could be any entity (not necessarily a book) that has Muhammad Ali as its author. To match the question exactly, the query should be filtering for books, such as:

SELECT DISTINCT ?uri 
WHERE { 
  ?uri wdt:P31 wd:Q571 . 
  ?uri wdt:P50 wd:Q36107 . 
}

or 

SELECT DISTINCT ?uri 
WHERE { 
  ?uri wdt:P50 wd:Q36107 ;
          wdt:P31 wd:Q571 .
}
